import styled from 'styled-components';

export const Container = styled.div`
  form{
    place-content: center;
  }
  button{
    width: 241px;
    height: 59px;
    background: #FBBC56 0% 0% no-repeat padding-box;
    box-shadow: 0px 10px 10px #00000029;
    border-radius: 12px;
    opacity: 1;
  }
`
